/* SFX DEFINITION */
var audio = { // The Data URIs for my sound effects. Located in /sfx/
  "eat": "data:audio/wav;base64,",
  "die": "data:audio/wav;base64,",
  "up": "data:audio/wav;base64,",
  "down": "data:audio/wav;base64,",
  "left": "data:audio/wav;base64,",
  "right": "data:audio/wav;base64,",
  "hover": "data:audio/wav;base64,",
  "play": "data:audio/wav;base64,"
};

/* AUDIO PLAYER FUNCTION */
function playSound(id, speed) {
  if (!audio[id]) {
    return;
  }
  let sound = audio[id];
  let player = new Audio();
  player.src = sound;
  player.onended = function() {
    player.remove();
  };
  player.style.display = "none";
  document.getElementById("sfx").appendChild(player);
  setTimeout(function() {
    player.play();
  }, 33);
}

/* SFX FUNCTION DEFINEMENT */
var sfx = {
  "eat": function() { // play /sfx/eat.wav
    playSound("eat");
  },
  "die": function() { // play /sfx/die.wav
    playSound("die");
  },
  "up": function() { // play /sfx/up.wav
    playSound("up");
  },
  "down": function() { // play /sfx/down.wav
    playSound("down");
  },
  "left": function() { // play /sfx/left.wav
    playSound("left");
  },
  "right": function() { // play /sfx/right.wav
    playSound("right");
  },
  "hover": function() { // play /sfx/hover.wav
    playSound("hover");
  },
  "play": function() { // play /sfx/play.wav
    playSound("play");
  }
};